import React, { useState, useContext } from 'react';
import { AuthContext } from '../contexts/AuthContext';
import { Link, useHistory } from 'react-router-dom';
import { signInWithEmailAndPassword, signInWithPopup } from 'firebase/auth';
import { doc, getDoc } from 'firebase/firestore';
import { auth, db, googleProvider } from '../firebaseInit';
import { Person } from '@mui/icons-material';
import Loading from '../components/Loading';
import { globalIconStyle } from '../assets/GlobalStyles';
import './Login.css';

const Login = () => {
    const history = useHistory();
    const { setIsProvider } = useContext(AuthContext);
    const [loading, setLoading] = useState(false);
    const [logInState, setlogInState] = useState({
        loginEmail: '',
        loginPassword: ''
    });

    const handleLoginChange = (e) => {
        setlogInState({
            ...logInState,
            [e.target.name]: e.target.value
        });
    };

    const onLoginSubmit = async (e) => {
        e.preventDefault();
        if (logInState.loginEmail && logInState.loginPassword) {
            setLoading(true);
            await signInWithEmailAndPassword(auth, logInState.loginEmail, logInState.loginPassword).then(async (userResponse) => {
                const finalUser = userResponse.user;
                const docSnap = await getDoc(doc(db, 'providers', finalUser.uid));
                if (docSnap.exists()) {
                    setIsProvider(true);
                    console.log(`isProvider true in login`);
                } else {
                    console.log(`isProvider false in login`);
                }
                alert(`Successfully logged in with finalUser.uid: ${finalUser.uid}`);
                history.push('/');
            }).catch((error) => {
                alert(`in login/firebaseSignInEmail: Error Code ${error.code}: ${error.message}`);
                setlogInState({
                    loginEmail: '',
                    loginPassword: ''
                });
                setLoading(false);
                return;
            });
        } else {
            alert('Please enter the Email and Password.');
            return;
        }
        setlogInState({
            loginEmail: '',
            loginPassword: ''
        });
        setLoading(false);
    };

    const loginWithGoogle = async () => {
        try {
            setLoading(true);
            const result = await signInWithPopup(auth, googleProvider);
            const user = result.user;

            // Check if the user is a provider
            const docSnap = await getDoc(doc(db, 'providers', user.uid));
            if (docSnap.exists()) {
                setIsProvider(true);
                console.log(`isProvider true in login`);
            } else {
                console.log(`isProvider false in login`);
            }

            alert(`Successfully logged in with Google: ${user.uid}`);
            history.push('/');
        } catch (error) {
            console.error("Google Login Error:", error);
            alert(`Google Login Error: ${error.message}`);
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className='login-container'>
            <div className='login-wrapper'>
                <div className='login-card'>
                    {loading ? <Loading /> : (
                        <>
                            <h2 style={{ textAlign: 'center', marginBottom: '1.5rem' }}>Log in</h2>
                            <form onSubmit={onLoginSubmit} className='login-form'>
                                <div className='form-group'>
                                    <label htmlFor="loginEmail">Email</label>
                                    <input
                                        id="loginEmail"
                                        type='email'
                                        name='loginEmail'
                                        placeholder='abc@example.com'
                                        value={logInState.loginEmail}
                                        onChange={handleLoginChange}
                                        required
                                    />
                                </div>

                                <div className='form-group'>
                                    <label htmlFor="loginPassword">Password</label>
                                    <input
                                        id="loginPassword"
                                        type='password'
                                        name='loginPassword'
                                        value={logInState.loginPassword}
                                        onChange={handleLoginChange}
                                        required
                                    />
                                </div>

                                <div className='button-container'>
                                    <button
                                        type='submit'
                                        className='login-button primary-button'
                                        disabled={loading}
                                    >
                                        {loading ? 'Logging in...' : 'Log in'}
                                    </button>

                                    <button
                                        type='button'
                                        onClick={loginWithGoogle}
                                        className='login-button google-login-button'
                                        disabled={loading}
                                    >
                                        <img
                                            src="/google-icon.png"
                                            alt=""
                                            style={{ width: '18px', height: '18px' }}
                                        />
                                        Continue with Google
                                    </button>
                                </div>

                                <div className='links-container'>
                                    <Link to="/forgot-password" className='link'>
                                        Forgot password?
                                    </Link>
                                    <Link to='/signup' className='link'>
                                        Create account
                                    </Link>
                                </div>
                            </form>
                        </>
                    )}
                </div>
            </div>
        </div>
    );
};

export default Login;
